import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="flex justify-between items-center h-28 w-full text-black fixed top-0 bg-green-100 z-10">
      <div className="flex gap-3 items-center px-16">
        <div className="w-4 h-4 bg-blue-800"></div>
        <p className=" text-2xl font-black tracking-wide">
          Nitin Tundwal{" "}
          <span className=" text-lg font-normal ">/ WEB DEVELOPER</span>
        </p>
      </div>
      <div className="flex gap-8 px-16 text-lg">
        <NavLink className=" hover:text-blue-600" to="/">
          ABOUT ME
        </NavLink>
        <NavLink className=" hover:text-blue-600" to="/resume">
          RESUME
        </NavLink>
        <NavLink className=" hover:text-blue-600" to="/projects">
          PROJECTS
        </NavLink>
        <NavLink className=" hover:text-blue-600" to="/contact">
          CONTACT
        </NavLink>
      </div>
    </div>
  );
};

export default Navbar;
